style.css:
@-moz-document domain("youtube.com"), url-prefix("https://www.youtube.com/") {
body, #content, #page-manager, #container, ytd-app {
        background-color: #0000FF !important;
    }
    ytd-masthead, #header {
        background-color: #00008B !important;
    }
    .ytp-chrome-top, .ytp-chrome-bottom, .ytp-chrome-controls {
        background-color: #00008B !important;
    }
    #content, #page-manager, ytd-app, ytd-masthead, #header, .ytp-chrome-top, .ytp-chrome-bottom, .ytp-chrome-controls {
        color: white !important;
    }
    /* Additional Elements */
    .style-scope ytd-topbar-logo-renderer, .style-scope ytd-topbar-logo-renderer, .style-scope ytd-topbar-logo-renderer, .style-scope ytd-topbar-logo-renderer, .style-scope ytd-topbar-logo-renderer {
        fill: white !important;
    }
}
